          if (this.stack.length < 2) {
            this.errstr = 'SCRIPT_ERR_INVALID_STACK_OPERATION';
            return false;
          }
          x1 = stacktop(-2);
          x2 = stacktop(-1);
          this.stack[this.stack.length - 2] = x2;
          this.stack[this.stack.length - 1] = x1;
